import React from 'react';
import {useNavigate} from "react-router-dom"
  
const Retour = () => {
  const navigate = useNavigate();
  
  return (
  <>
     <button onClick={()=>navigate(-1)}>Retour</button>
  </>
  )
};
  
export default Retour;
